import { Facebook, Instagram, LinkedIn, Pinterest, Twitter } from '@material-ui/icons'
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`

    display:flex;

`
const Left = styled.div` 

        flex:1;
        display:flex;
        flex-direction:column;
        padding: 20px;

`
const Logo = styled.h1`

 
        margin:0;
`
const Desc = styled.p`

 margin:20px 0;
`
const SocialContainer = styled.div`

        display:flex;


`
const SocialIcon = styled.div`

        width:40px;
        height:40px;
        border-radius:50%;
        color:white;
        background-color:#${props => props.bgcolor === 'Facebook' && '3B5999'};
        background-color:#${props => props.bgcolor === 'Twitter' && 'E4405F'};
        background-color:#${props => props.bgcolor === 'Insta' && '55ACEE'};
        background-color:#${props => props.bgcolor === 'Pinterest' && 'E60023'};
        
                display:flex;
        align-items:center;
        justify-content:center;

`
const Center = styled.div`

        flex:1;

`

const Right = styled.div` 

        flex:1;

`


const Footer = () => {
    return (
        <Container>
            <Left>
                <Logo>Cart</Logo>
                <Desc>There needs to be someone to take care of
                    Something which does not belong to him yet he or she
                    takes care of it as if its theirs</Desc>
                <SocialContainer>
                    <SocialIcon bgcolor='Facebook'>
                        <Facebook/>
                    </SocialIcon>
                    <SocialIcon bgcolor='Twitter'>
                        <Twitter/>
                    </SocialIcon>
                    <SocialIcon bgcolor='Insta'>
                        <Instagram/>
                    </SocialIcon>
                    <SocialIcon bgcolor='Pinterest'>
                        <Pinterest/>
                    </SocialIcon>
                </SocialContainer>
            </Left>
            <Center></Center>
            <Right></Right>
        </Container>
    )
}

export default Footer
